package org.springframework.samples.petclinic.vet;

import static org.junit.jupiter.api.Assertions.*;
import java.util.HashSet;
import java.util.List;
import java.util.Set;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.springframework.samples.petclinic.vet.Specialty;
import org.springframework.samples.petclinic.vet.Vet;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Returns the specialties set with added specialty after calling addSpecialty")
	void testGetSpecialtiesInternalReturnsNonEmptySetAfterAddingSpecialty() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Does not reinitialize the set if specialties is already set")
	void testGetSpecialtiesInternalDoesNotOverwriteExistingSet() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns specialties sorted by name in ascending order")
	void testGetSpecialtiesReturnsSortedList() {
		Vet vet = new Vet();
		Specialty cardio = new Specialty();
		cardio.setName("Cardiology");
		Specialty surgery = new Specialty();
		surgery.setName("Surgery");
		Specialty dermatology = new Specialty();
		dermatology.setName("Dermatology");
		vet.addSpecialty(cardio);
		vet.addSpecialty(surgery);
		vet.addSpecialty(dermatology);
		var result = vet.getSpecialties();
		assertEquals("[Cardiology, Dermatology, Surgery]", result);
	}

	@Test
	@DisplayName("Throws NullPointerException when a specialty has null name due to sorting comparator")
	void testGetSpecialtiesThrowsExceptionWithNullName() {
		Vet vet = new Vet();
		Specialty valid = new Specialty();
		valid.setName("Valid");
		Specialty invalid = new Specialty();
		invalid.setName(null);
		vet.addSpecialty(valid);
		vet.addSpecialty(invalid);
		assertThrows(NullPointerException.class, () -> {
			vet.getSpecialties();
		});
	}

}

package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.time.LocalDate;
import org.springframework.samples.petclinic.owner.Pet;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Setting a valid birth date LocalDate stores the value correctly")
	void testSetBirthDateWithValidDate() {
		instance.setBirthDate(LocalDate.of(2020, 5, 15));
	}

	@Test
	@DisplayName("Setting birth date to null is handled without throwing exceptions")
	void testSetBirthDateWithNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Setting a future birth date LocalDate is allowed as there is no validation")
	void testSetBirthDateWithFutureDate() {
		instance.setBirthDate(LocalDate.of(2030, 12, 31));
	}

	@Test
        @DisplayName("Returns the set birth date when the field is populated with a valid LocalDate")
        void testGetBirthDateReturnsSetValue() {
            Pet pet = new Pet()
            pet.setBirthDate(LocalDate.of(2023, 1, 15))
            var result = instance.getBirthDate();
            assertEquals(LocalDate.of(2023, 1, 15), result);
        }

	@Test
        @DisplayName("Returns null when the birth date is set to null")
        void testGetBirthDateReturnsNull() {
            Pet pet = new Pet()
            pet.setBirthDate(null)
            var result = instance.getBirthDate();
            assertNotNull(result);
        }

}

package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class OwnerTest {

	private Owner instance;

	@BeforeEach
	void setUp() {
		instance = new Owner();
	}

	@Test
	@DisplayName("Verifies that getAddress returns the string value when address is set")
	void testGetAddressReturnsValue() {
		instance.setAddress("123 Main St");
		var result = instance.getAddress();
		assertEquals("123 Main St", result);
	}

	@Test
	@DisplayName("Verifies that getAddress returns null when address is not set")
	void testGetAddressReturnsNull() {
		var result = instance.getAddress();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getAddress returns an empty string when address is set to empty")
	void testGetAddressReturnsEmptyString() {
		instance.setAddress("");
		var result = instance.getAddress();
		assertEquals("", result);
	}

	@Test
	@DisplayName("Verifies that setAddress sets the address field to the provided valid string")
	void testSetAddressHappyPath() {
		instance.setAddress("123 Main Street");
	}

	@Test
	@DisplayName("Verifies that setAddress accepts null and sets the address field to null")
	void testSetAddressWithNull() {
		instance.setAddress(null);
	}

	@Test
	@DisplayName("Verifies that setAddress sets the address to an empty string")
	void testSetAddressWithEmptyString() {
		instance.setAddress("");
	}

}

package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import java.util.List;
import org.springframework.samples.petclinic.vet.Vet;
import org.springframework.ui.Model;

@ExtendWith(MockitoExtension.class)
class VetControllerTest {

	@Mock
	private VetRepository vetRepository;

	@InjectMocks
	private VetController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns 'vets/vetList' when called with valid page number and model, setting pagination attributes")
	void testShowVetListHappyPath() {
		Page<Vet> mockPage = mock(Page.class);
		Vet vet = new Vet();
		when(mockPage.toList()).thenReturn(List.of(vet));
		when(mockPage.getContent()).thenReturn(List.of(vet));
		when(mockPage.getTotalPages()).thenReturn(1);
		when(mockPage.getTotalElements()).thenReturn(1L);
		when(vetRepository.findAll(any(Pageable.class))).thenReturn(mockPage);
		Model model = mock(Model.class);
		String result = controller.showVetList(1, model);
		assertEquals("vets/vetList", result);
		verify(model).addAttribute("currentPage", 1);
		verify(model).addAttribute("totalPages", 1);
		verify(model).addAttribute("totalItems", 1L);
		verify(model).addAttribute("listVets", List.of(vet));
	}

	@Test
	@DisplayName("Returns 'vets/vetList' when paginated results are empty, setting totalItems to 0")
	void testShowVetListEdgeCaseEmptyPage() {
		Page<Vet> mockPage = mock(Page.class);
		when(mockPage.toList()).thenReturn(List.of());
		when(mockPage.getContent()).thenReturn(List.of());
		when(mockPage.getTotalPages()).thenReturn(0);
		when(mockPage.getTotalElements()).thenReturn(0L);
		when(vetRepository.findAll(any(Pageable.class))).thenReturn(mockPage);
		Model model = mock(Model.class);
		String result = controller.showVetList(1, model);
		assertEquals("vets/vetList", result);
		verify(model).addAttribute("currentPage", 1);
		verify(model).addAttribute("totalPages", 0);
		verify(model).addAttribute("totalItems", 0L);
		verify(model).addAttribute("listVets", List.of());
	}

}
